function do_analysis_of_sex

% import stats results
comparison_type = 'compare_between_sexes';
all_txt_stats = import_txt_stats(comparison_type);

% extract data for each dataset
datasets = fieldnames(all_txt_stats);

for dataset_no = 1 : length(datasets)
    
    eval(['txt_stats = all_txt_stats.' datasets{dataset_no} ';']);

    % extract comparison data
    [comparisons{dataset_no,1}, data{dataset_no,1}] = extract_comparison_data(txt_stats);

end

% check beat detectors are in the same order
if ~isequal(data{1}.beat_detector1, data{2}.beat_detector1) || ~isequal(data{1}.beat_detector1, data{3}.beat_detector1)
    error('check this')
end

%% Generate table of p-values

tbl.beat_detectors = sort(data{1}.beat_detector1);
tbl.datasets = datasets;
tbl.pvalues = nan(length(tbl.beat_detectors), length(tbl.datasets));
sig_thresh = 0.05;
bon_pval = sig_thresh/length(tbl.beat_detectors);

% cycle through each dataset
for dataset_no = 1 : length(tbl.datasets)

    curr_pvalues = data{dataset_no}.pvalue;
    curr_beat_detectors = data{dataset_no}.beat_detector1;
    
    % cycle through each beat detector
    for beat_detector_no = 1 : length(tbl.beat_detectors)
        rel_row = strcmp(curr_beat_detectors, tbl.beat_detectors(beat_detector_no));
        tbl.pvalues(beat_detector_no, dataset_no) = curr_pvalues(rel_row);
    end
end

% output latex table

fprintf('\n ~~~ Latex table of p-values for comparisons between genders ~~~')

fprintf('\n\\begin{table*}[p!]')
fprintf('\n\\caption{p-values for comparisons between males and females. \\textit{* indicates a significant p-value after applying a Bonferoni correction for multiple comparisons.}}')
fprintf('\n\\label{tab:pvalues_sex}')
fprintf('\n\\begin{tabular}{lllll}')
fprintf('\n\\toprule')
fprintf('\n\\textbf{QRS} & \\multicolumn{%d}{c}{\\textbf{Dataset}} \\\\', length(tbl.datasets))
fprintf('\n\\cline{2-5}')
fprintf('\n\\textbf{Detector} & ')
for dataset_no = 1 : length(tbl.datasets)
    fprintf('\\textbf{%s}', tbl.datasets{dataset_no,1})
    if dataset_no<length(tbl.datasets)
        fprintf(' & ')
    else
        fprintf(' \\\\')
    end
end
fprintf('\n\\midrule')
for beat_detector_no = 1 : length(tbl.beat_detectors)
    fprintf('\n\\textbf{%s} & ', tbl.beat_detectors{beat_detector_no})
    for dataset_no = 1 : length(tbl.datasets)
        fprintf('%.3f', tbl.pvalues(beat_detector_no,dataset_no))
        if tbl.pvalues(beat_detector_no,dataset_no) < bon_pval
            fprintf('*')
        end
        if dataset_no<length(tbl.datasets)
            fprintf(' & ')
        else
            fprintf(' \\\\')
        end
    end
end
fprintf('\n\\end{tabular}')
fprintf('\n\\end{table*}\n')

end

function do_analysis_of_different_datasets

% import stats results
comparison_type = 'different_datasets';
txt_stats = import_txt_stats(comparison_type);

% extract comparison data
[comparisons, data] = extract_comparison_data(txt_stats);

% do analysis
fprintf('\n ~~~ Doing analysis of significant differences ~~~')
comps = {'ARR', 'SIN'; ...
    'SAFER-AF-HIGH', 'SAFER-nonAF-HIGH'; ...
    'SIN', 'SAFER-nonAF-HIGH'; ...
    'ARR', 'SAFER-AF-HIGH'; ...
    'SAFER-nonAF-HIGH', 'SAFER-nonAF-LOW'; ...
    'HIGH', 'LOW'};
comp_cats = {'investigate effect of arrhythmia'; ...
    'investigate effect of arrhythmia'; ...
    'compare supervised and telehealth'; ...
    'compare supervised and telehealth'; ...
    'investigate effect of quality'; ...
    'investigate effect of quality'};
no_comps = size(comps,1);
[res.no_beat_detectors, res.no_sig] = deal(nan(no_comps,1));
sig_thresh = 0.05;
for comp_no = 1 : no_comps
    fprintf('\n - Comparison %s vs. %s', comps{comp_no,1}, comps{comp_no,2});
    fprintf('\n   (to %s)', comp_cats{comp_no})
    first_dataset_inc = strcmp(data.dataset1, comps{comp_no,1}) | strcmp(data.dataset2, comps{comp_no,1});
    second_dataset_inc = strcmp(data.dataset1, comps{comp_no,2}) | strcmp(data.dataset2, comps{comp_no,2});
    rel_rows = first_dataset_inc & second_dataset_inc;
    res.no_beat_detectors(comp_no) = sum(rel_rows);
    
    % calculate bonferonni corrected p-value
    bon_pval = sig_thresh/res.no_beat_detectors(comp_no);
    res.no_sig(comp_no) = sum(data.pvalue(rel_rows)<bon_pval);
    
    % output results
    fprintf('\n     - Significant difference for %d out of %d beat detectors', res.no_sig(comp_no), res.no_beat_detectors(comp_no));
    pvalues = data.pvalue(rel_rows);
    beat_detectors = data.beat_detector1(rel_rows);
    for beat_detector_no = 1 : res.no_beat_detectors(comp_no)
        if pvalues(beat_detector_no)>=bon_pval
            fprintf('\n     - No significant difference for %s', beat_detectors{beat_detector_no});
        end
    end

    % store p-values
    res.pvalues(comp_no,1).v = pvalues;
    res.pvalues(comp_no,1).nom = beat_detectors;
    res.pvalues(comp_no,1).sig_bon = res.pvalues(comp_no).v<bon_pval;
    
end
res.comps = comps;
res.comp_cats = comp_cats;

%% Generate table of p-values

tbl.beat_detectors = sort(res.pvalues(1).nom);
tbl.comps = cell(length(res.comps),1);
tbl.pvalues = nan(length(tbl.beat_detectors), length(tbl.comps));

% cycle through each comparison
for comp_no = 1 : no_comps

    curr_pvalue = res.pvalues(comp_no).v;
    curr_beat_detectors = res.pvalues(comp_no).nom;
    tbl.comps{comp_no} = [res.comps{comp_no,1} ' vs. ' res.comps{comp_no,2}];

    % cycle through each beat detector
    for beat_detector_no = 1 : length(tbl.beat_detectors)
        rel_row = strcmp(curr_beat_detectors, tbl.beat_detectors(beat_detector_no));
        tbl.pvalues(beat_detector_no, comp_no) = curr_pvalue(rel_row);
    end
end

% output latex table

fprintf('\n ~~~ Latex table of p-values for comparisons ~~~')

fprintf('\n\\begin{table*}[p!]')
fprintf('\n\\caption{p-values for comparisons between datasets. \\textit{* indicates a significant p-value after applying a Bonferoni correction for multiple comparisons.}}')
fprintf('\n\\label{tab:pvalues}')
fprintf('\n\\begin{tabular}{lllllll}')
fprintf('\n\\toprule')
fprintf('\n\\textbf{QRS} & \\multicolumn{%d}{c}{\\textbf{Comparison}} \\\\', no_comps)
fprintf('\n\\cline{2-7}')
fprintf('\n\\textbf{Detector} & ')
for comp_no = 1 : no_comps
    fprintf('\\textbf{%s} vs.', res.comps{comp_no,1})
    if comp_no<no_comps
        fprintf(' & ')
    else
        fprintf(' \\\\')
    end
end
fprintf('\n & ')
for comp_no = 1 : no_comps
    fprintf('\\textbf{%s}', res.comps{comp_no,2})
    if comp_no<no_comps
        fprintf(' & ')
    else
        fprintf(' \\\\')
    end
end
fprintf('\n\\midrule')
for beat_detector_no = 1 : length(tbl.beat_detectors)
    fprintf('\n\\textbf{%s} & ', tbl.beat_detectors{beat_detector_no})
    for comp_no = 1 : no_comps
        fprintf('%.3f', tbl.pvalues(beat_detector_no,comp_no))
        if tbl.pvalues(beat_detector_no,comp_no) < bon_pval
            fprintf('*')
        end
        if comp_no<no_comps
            fprintf(' & ')
        else
            fprintf(' \\\\')
        end
    end
end
fprintf('\n\\end{tabular}')
fprintf('\n\\end{table*}\n')

end

function [comparisons, data] = extract_comparison_data(txt_stats)

loc_spaces = [0, strfind(txt_stats, ' ')];
loc_comparisons = strfind(txt_stats, ' v.s. ');
loc_pvalues = strfind(txt_stats, 'P_val=');

comparisons = cell(length(loc_comparisons), 3);
for comparison_no = 1 : length(loc_comparisons)
    curr_loc_comparison = loc_comparisons(comparison_no);
    % first beat detector
    comparison_start = 1+loc_spaces(find(loc_spaces<curr_loc_comparison, 1, 'last'));
    comparisons{comparison_no,1} = txt_stats(comparison_start:curr_loc_comparison-1);
    % second beat detector
    temp = loc_spaces(find(loc_spaces>curr_loc_comparison, 2, 'first'));
    curr_detector_end = temp(2)-2;
    comparisons{comparison_no,2} = txt_stats(curr_loc_comparison+6:curr_detector_end);
    % p-value
    temp = loc_pvalues(find(loc_pvalues>curr_loc_comparison,1));
    pval_start = temp+6;
    temp = loc_spaces(find(loc_spaces>pval_start,1));
    comparisons{comparison_no,3} = txt_stats(pval_start:temp-1);

end

% extract required data
[data.beat_detector1, data.beat_detector2, data.dataset1, data.dataset2] = deal(cell(length(loc_comparisons),1));
data.pvalue = nan(length(loc_comparisons),1);
for comparison_no = 1 : length(loc_comparisons)
    temp = comparisons{comparison_no,1};
    temp_el = strfind(temp, '_');
    data.beat_detector1{comparison_no} = temp(1:temp_el-1);
    data.dataset1{comparison_no} = temp(temp_el+1:end);
    temp = comparisons{comparison_no,2};
    temp_el = strfind(temp, '_');
    data.beat_detector2{comparison_no} = temp(1:temp_el-1);
    data.dataset2{comparison_no} = temp(temp_el+1:end);
    data.pvalue(comparison_no) = str2double(comparisons{comparison_no,3});

end
data = struct2table(data);

% do some checks
if ~isequal(data.beat_detector1, data.beat_detector2)
    error('these should be equal')
end

end